import React, { useState, useEffect } from 'react';

const Search = () => {
    onInputChange = (e) => {
        console.log(e.target.value);
    };

    return (
        <div>
            <div className="ui form">
                <div className="field">
                    <label>Enter Search Term</label>
                    <input className="input" type="text" onChange={this.onInputChange} />
                </div>
            </div>
        </div>
    );
};

export default Search;
